 import React from 'react';
 import ReactDOM from 'react-dom';
 import './index.css';

 const t =new Date().getHours();
let greet='';
let cssStyle={}
if(t>=1 && t<12){
    greet='good morning'
    cssStyle.color='red'
}else if (t>=2 && t<19){
    greet='good afternoon'
    cssStyle.color='blue'
}else{
    greet='nigth'
    cssStyle.color='green'
}

 ReactDOM.render( 
<>
<h1>helloo mou <span style={cssStyle}>{greet}</span></h1>
</>,
     document.getElementById('root')
 );
